window.bookSummaryJSON = "Equipped with the latest weaponry, and carrying more than 200 sailors, the orbiting warship <i>USS Michaelson</i> is armored against the hazards of space and the threats posed in the vast nothing between planets. But who will protect her from the threats within? <p>Ensign Paul Sinclair is assigned to the <i>Michaelson</i> as the ship's lone legal officer, a designation that carries grave consequences when the ship's captain, Pete Wakeman, is ordered to return to port for court-martial. His crime: ordering the destruction of a civilian research vessel. What happens when a man of power breaks a law that reaches across the universe? The answer is for Sinclair to expose or to conceal, actions that could destroy the futures of both men.</p> <p><b>BONUS AUDIO: Includes an exclusive introduction written and read by author Jack Campbell.</b></p> <p><i>A Just Determination</i> was originally published as \"by John G. Hemry\".</p>"; 
